item.prod_desc:
Klosz Josephine to zmysłowe dzieło sztuki połyskujące niczym diament. Stanowi nowoczesną interpretację tradycyjnej wiszącej lampy. Połyskująca powierzchni roztacza blask w okół dodając ekskluzywnego charakteru i pozytywnej energii. Josephine to abażur, który stanowić będzie wyraźny element wystroju ze względu na blask, odważny projekt i intensywną kolorystykę. Marka Koziol stawia na indywidualizm pozwalajac na skomponowanie kolorystyki lampy samodzielnie, zgodnie z własnym uznaniem i potrzebami oferując osobno klosz i osobno zawieszenie (dostępne w pięciu kolorach).
 Zawiesznie nie wchodzi w skład zestawu, należy je zamawiać osobno.
